			"inner_gloves": "The Yamaha Chevron Gloves by REVIT! combine the protective elements of a true sport glove with the functionality and ventilation of a mesh summer glove.  The gloves are designed for comfortable high-speed summer touring and features: Ventilation panels; TPU hard-shell little finger protector; TPU hard-shell finger knuckles; Carbon hard shell knuckle; Temperfoam at thumb and palm; Adjustment tab; Goatskin, perforated goatskin and synthetic PU leather; Outer shell: 84% leather, 16% polyurethane; Lining: 100% polyester",
			"inner_jacket": "Enjoy the comfort of full ventilation on even the hottest of days while looking sporty at the same time. The Yamaha Airforce Jacket features: Ventilation panels; Visibility laminated reflection; Laminated reflective logo; CE rated Knox Flexiform armor; Slit and inner pocket; Designed with both short connection zipper and jeans loop to connect to any pants you prefer; Adjustment strap and tabs; Outer shell: polyester 600D, PWR|shell mesh, polyester 450D EN471, Lorica; Lining: 100% polyester; Optional CE-level 2 Seesoft Back Protector available from REVIT!; Optional Challenger Cooling Vest available from REVIT!",
			"inner_helmet": "The Yamaha Y17 Helmet by HJC features: Full Face; Advanced Polycarbonate Composite Shell lightweight, superior fit and comfort using advanced CAD technology; One-touch Integrated Sunshield- 3 stage adjustable sunshield deploys quickly and easily; Optically superior Pinlock-prepared 3D face shield- provides 95% UV protection; Innovative Center one-touch open/close locking system designed for an extremely secure seal; ACS Advanced Channeling Ventilation System- full front to back airflow flushed heat and humidity up and out; SuperCool Interior- crown and cheek pads are removable and washable; DOT approved; Available in Rubbertone Gray and Silver",
