			"title_feature5": "Compact, Confident Rider Seating",
			"description_feature5": "With a flat seat design and a seat height of only 30.7 inches on the YZF-R3, its easy to get both feet firmly on the ground and inspire confidence, especially for beginner riders.",
			"pic_specs": "src/images/specs.png",
