			"pic_speed": "src/images/speedometer.png",
			"speed_value1": "YZ450F-based frame offers a compact size while optimizing mass centralization. With its extensively tested assembly of aluminum forgings and extrusions complete with model-specific engine mounting, the WR450F frame retains legendary Yamaha handling and response. Compact YZ450F-based chassis provides a lightweight feeling with advanced suspension systems for plush and responsive performance for the most demanding rider. Industry leading, fully adjustable YZ450F-based KYB spring-type fork with speed-sensitive damping and Kashima Coat has been specifically tested and tuned for enduro racing and delivers precise, fade-free handling. Fork protectors provide excellent tube protection. The KYB shock provides 12.5 inches of wheel travel with adjusters for high- and low-speed compression damping, rebound and spring preloadand features a large piggyback reservoir for excellent damping and fade resistance. Large diameter 270mm front brake system is the same disc fitted to the 2016 YZ450F, for exceptional stopping power and braking control. 18-inch enduro-specific rear wheel and tire provides added comfort on rough trails as well as reducing the possibility of pinch flats.",
