			"inner_data13": "An ECU is an Engine Control Unit, its what controls the engine and its operations. The ECU is a computer that has been programmed to run the engine of your vehicle. The engine control unit goes through thousands of calculations a second, calculating the amount of fuel needed for the current throttle load and RPM, the Ecu needs to calculate many sensory inputs such as air flow and air temperature at that precise moment. Modern ecus make easy work of these calculations and run engines very well, with modern Electronic Fuel Injection systems the aim is to maximise the operational output of an engines capability, making full use of the fuel used for combustion and making engines as efficient as possible, trying to get ever last bit of energy from the combustion to turn into power to the wheels of the vehicle.",
