			"title_power2": "Compact Stacked Transmission",
			"description_power2": "A 6-speed transmission is built to match the engines delivery and character for excellent response. The transmission 'stacks' the input/output shafts to centralize mass and to keep the overall engine size shorter front to back, which optimizes engine placement in the frame for outstanding weight balance.",
