			"description_feature1": "The 2016 XJR1300 features a lightweight and compact crossplane-crankshaft, inline-four-cylinder, 998cc high output engine, producing excellent power and a strong pulse of linear torque for stunning performance.",
			"title_feature2": "Class-leading Electronics Package",
			"description_feature2": "The XJR1300 features an advanced MotoGP-inspired electronics package: a suite of inter-related technologies, enabling the rider to enjoy the fullest range of performance with great comfort, control, and ease of operation.",
			"title_feature3": "MotoGP-level Controllability",
			"description_feature3": "Featuring Yamahas six-axis Inertial Measurement Unit (IMU), the 2016 R1S represents the state-of-the-art in digital riding control, where all riders can experience total 3D controllability.",
			"title_feature4": "Informed Systems",
			"description_feature4": "The IMU consists of a gyro sensor that measures pitch, roll, and yaw, as well as an accelerometer, or G-sensor, that measures acceleration in the fore-aft, up-down, and right-left directions all at a rate of 125 calculations per second. By calculating each signal, the IMU finds the precise vehicle position and movement, and communicates it to the ECU, enabling it to control the bikes systems.",
