			"spect_value4": "Fuel Injection",
			"specs_title5": "Ignition",
			"spect_value5": "TCI: Transistor Controlled Ignition",
			"specs_title6": "Transmission",
			"spect_value6": "5-speed; multiplate wet clutch",
			"specs_title7": "Final Drive",
			"spect_value7": "Shaft",
			"pic_speed": "src/images/speedometer.png",
			"speed_value1": "Headlined by the LED headlight system, the FJR1300ESs stylish, supersport-inspired bodywork with integrated airflow management keeps the rider comfortable. A central vent beneath the instrument panel reduces negative pressure for less buffeting, and adjustable fairing side panels let the rider direct lower body airflow. Electronically adjusted suspension makes finding the right setting as easy as pushing a button. With four pre-load settings, three damping presets, and an additional seven damping fine-tuning adjustments, the FJR1300ES suspension can be dialed-in to meet the needs of the rider, passenger and the riding conditions. Advanced brakes front and rear provide exceptional braking power and control, and are linked via Yamahas Unified Braking System, for balanced braking power. ABS further boosts rider confidence by preventing wheel lock-ups in reduced-traction conditions.",
			"pic_life": "src/images/roadlife.png",
