			"inner_data21": "Some want an environmentally friendly, cheap way to get around. Some are in it for the excitement. Others are in it for the lifestyle. Most just want to be healthy and have fun! Whatever your reason, we're here to help. You see, we love to ride bikes too, and we think that everyone should ride with us. Were working hard to make cycling accessible, affordable and unintimidating. Here at bikewagon, we know that life is so much more than a low price. Our goal is to provide value in everything we do, and we know that value isn't just found in a dollar sign. ",
